window.bookSummaryJSON = "<p><b>Stone Barrington takes down old and new enemies in the latest thriller from perennial fan favorite Stuart Woods.</b></p> <p>After a rocky jaunt in Maine, Stone Barrington is settling back in New York City when an old client reaches out for help with a delicate matter. A feud they thought was put to rest long ago has reemerged with a vengeance, and reputations - and money - are now on the line.</p> <p>As Stone sets out to unravel a tangled web of crime and secrets, his mission becomes even more complicated when he makes an irresistible new acquaintance. In both the underbelly and upper echelons of New York, everyone has something to hide - and if Stone has learned anything, itâ€™s that history has a way of repeating itself....</p>"; 
